import React from 'react';
import cl from './Posts.module.css';

const Posts = () => {
    return (
        <div>
            My posts
            <div>
                New post
            </div>
            <div className={cl.posts}>
                <div className={cl.item}>
                    post 1
                </div>
                <div className={cl.item}>
                    post 2
                </div>
            </div>
        </div>
    );
}

export default Posts;
